import { useNavigate } from "react-router-dom";
import { Link } from "react-router-dom";

const House = (props) => {
  const navigate = useNavigate();
  console.log(props.house);
  console.log(props.chooseHouse[props.index]);
  return (
    <div className="houseBG">
      <button onClick={() => navigate(-1)}><img src="../icons/arrow_back.svg" alt="back"/></button>
      <div></div>
      {props.house.map((value,index)=>{
        if(props.chooseHouse[props.index]===value.name)
        {
          return <div><h1>{value.founder}</h1></div>
        }
      })}

    </div>
  );
};

export default House;
